import { ref, computed } from 'vue';
import { useAuth } from './useAuth';
import { quizHistory } from '../lib/supabase';

export function useQuizHistory() {
  const { user, temporaryHistory } = useAuth();
  const persistentHistory = ref([]);
  const isLoading = ref(false);
  const error = ref(null);

  // Combine temporary and persistent history based on auth state
  const history = computed(() => {
    if (user.value) {
      return persistentHistory.value;
    }
    return temporaryHistory.value;
  });

  // Load quiz history from appropriate source
  const loadHistory = async () => {
    if (!user.value) {
      return; // Use temporary history from localStorage
    }

    isLoading.value = true;
    error.value = null;

    try {
      const { data, error: fetchError } = await quizHistory.getQuizzes();
      if (fetchError) throw fetchError;
      persistentHistory.value = data;
    } catch (err) {
      error.value = err.message;
    } finally {
      isLoading.value = false;
    }
  };

  // Save quiz to appropriate storage
  const saveQuiz = async (quizData) => {
    error.value = null;

    if (!user.value) {
      // Save to temporary storage
      temporaryHistory.value = [quizData, ...temporaryHistory.value];
      return { data: quizData, error: null };
    }

    try {
      // Save to Supabase
      const { data, error: saveError } = await quizHistory.saveQuiz({
        ...quizData,
        user_id: user.value.id
      });
      if (saveError) throw saveError;
      persistentHistory.value = [data[0], ...persistentHistory.value];
      return { data: data[0], error: null };
    } catch (err) {
      error.value = err.message;
      return { data: null, error: err };
    }
  };

  // Migrate temporary history to persistent storage
  const migrateTemporaryHistory = async () => {
    if (!user.value || temporaryHistory.value.length === 0) {
      return;
    }

    error.value = null;
    
    try {
      const quizzesToMigrate = temporaryHistory.value.map(quiz => ({
        ...quiz,
        user_id: user.value.id
      }));

      const { data, error: migrateError } = await quizHistory.migrateTemporaryHistory(quizzesToMigrate);
      if (migrateError) throw migrateError;

      // Clear temporary history after successful migration
      temporaryHistory.value = [];
      persistentHistory.value = [...data, ...persistentHistory.value];

      return { data, error: null };
    } catch (err) {
      error.value = err.message;
      return { data: null, error: err };
    }
  };

  // Clear history from appropriate storage
  const clearHistory = async () => {
    error.value = null;

    if (!user.value) {
      temporaryHistory.value = [];
      return { error: null };
    }

    try {
      const { error: clearError } = await quizHistory.clearHistory();
      if (clearError) throw clearError;
      persistentHistory.value = [];
      return { error: null };
    } catch (err) {
      error.value = err.message;
      return { error: err };
    }
  };

  return {
    history,
    isLoading,
    error,
    loadHistory,
    saveQuiz,
    migrateTemporaryHistory,
    clearHistory
  };
}
